import React from "react";
import "./styles.css";
import LeftSection from "./LeftSection";
import RightSection from "./RightSection";

import { getData } from "./eventsData";

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      eventsData: []
    };
  }

  componentDidMount() {
    const respData = getData();
    this.setState({ eventsData: respData });
  }


  render() {
    const { eventsData } = this.state;

    this.state = {startDate:1519026163000, timeEnd:1519126755000} // example

const startDate = moment(this.state.startDate);
const timeEnd = moment(this.state.timeEnd);
const diff = timeEnd.diff(startDate);
const diffDuration = moment.duration(diff);

console.log("Total Duration in millis:", diffDuration.asMilliseconds());
console.log("Days:", diffDuration.days());
console.log("Hours:", diffDuration.hours());
console.log("Minutes:", diffDuration.minutes());
console.log("Seconds:", diffDuration.seconds());

    return (
      <div className="container">
        <LeftSection eventsData={eventsData} />
        <RightSection eventsData={eventsData} />
      </div>
    );
  }
}

export default App;
